export const getStudent=(student)=>{
    return async(dispatch)=>{
        try{    
            const {data} = await axios.get("/student.json");
            dispatch(loadStudent(data));
        }catch(error){
            console.log(error);
        }
    }
}

export const loadStudent=(student)=>{
    type:GET_STUDENT,
    student
}
